import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"

const img1 = "https://picsum.photos/100/100";
const img2 = "https://picsum.photos/100/100";
const img3 = "https://picsum.photos/100/100";
const link = "https://www.facebook.com";

ReactDOM.render(
  <>
    <h1 className="heading">My name is vinod</h1>
    <div className="image">

    </div>
    <img src={img1} />
    <img src={img2} />
    <a href={link} target="_blank" >
    <img src={img3} />
    </a>
  </>
  ,
  document.getElementById("root"));
